import logo from './logo.svg';
import './App.css';
import { Users } from './Users.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-link"
          href="https://ptzhost.ru"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      { Users }
    </div>
  );
}

export default App;
